CREATE TABLE T_BOOKMARK (
    USR_ID VARCHAR(20) NOT NULL,
    FVR_ID VARCHAR(255) NOT NULL,
    FVR_PID VARCHAR(15) DEFAULT NULL,
    FVR_NM VARCHAR(255) DEFAULT NULL,
    SORT_ORDER BIGINT DEFAULT NULL,
    REG_ID VARCHAR(20) DEFAULT NULL,
    REG_DT TIMESTAMP NULL,
    UPD_ID VARCHAR(20) DEFAULT NULL,
    UPD_DT TIMESTAMP NULL,
    PRIMARY KEY (USR_ID,FVR_ID)
);

CREATE TABLE T_CODE_MGMT (
    GRP_CODE_ID VARCHAR(32) NOT NULL,
    CODE_ID VARCHAR(32) NOT NULL,
    CODE_NAME VARCHAR(150) DEFAULT NULL,
    CODE_DESC VARCHAR(250) DEFAULT NULL,
    USE_YN VARCHAR(1) DEFAULT NULL,
    REG_ID VARCHAR(20) NOT NULL,
    REG_DT TIMESTAMP NOT NULL,
    UPD_ID VARCHAR(20) NOT NULL,
    UPD_DT TIMESTAMP NOT NULL,
    PRIMARY KEY (GRP_CODE_ID,CODE_ID)
);

CREATE TABLE T_EPLOG (
    FLGCD VARCHAR(32) NOT NULL,
    FLGCD_RSTVL VARCHAR(255) NOT NULL,
    CA_URI VARCHAR(1500) DEFAULT NULL,
    USR_IP VARCHAR(30) DEFAULT NULL,
    USR_ID VARCHAR(20) DEFAULT NULL,
    YR BIGINT NOT NULL,
    YYMM BIGINT NOT NULL,
    YYMMDD BIGINT NOT NULL,
    YYMMDDHH BIGINT NOT NULL,
    REG_ID VARCHAR(20) DEFAULT NULL,
    REG_DT TIMESTAMP NULL,
    UPD_ID VARCHAR(20) DEFAULT NULL,
    UPD_DT TIMESTAMP NULL
);

CREATE TABLE T_GROUPS (
    ORNCD VARCHAR(10) NOT NULL,
    ORN_STCD VARCHAR(10) NOT NULL,
    ORNNM VARCHAR(100) NOT NULL,
    SAME_LVL_SEQNO BIGINT NOT NULL DEFAULT 0,
    AMG_ORNCDYN VARCHAR(1) DEFAULT 'N',
    PPR_ORNCD VARCHAR(10) NOT NULL,
    ORN_FLGCD VARCHAR(10) DEFAULT NULL,
    ORN_TPCD VARCHAR(10) DEFAULT NULL,
    ORN_SPCD VARCHAR(10) DEFAULT NULL,
    ORN_RL_FLGCD VARCHAR(10) DEFAULT NULL,
    ORN_LVL BIGINT DEFAULT 0,
    BZP_TPCD VARCHAR(10) DEFAULT NULL,
    REG_ID VARCHAR(20) NOT NULL,
    REG_DT TIMESTAMP NOT NULL,
    UPD_ID VARCHAR(20) NOT NULL,
    UPD_DT TIMESTAMP NOT NULL,
    PRIMARY KEY (ORNCD)
);

CREATE TABLE T_LINK (
    LINK_ID VARCHAR(32) NOT NULL,
    LINK_CATG VARCHAR(32) NOT NULL,
    LINK_NAME VARCHAR(150) DEFAULT NULL,
    LINK_DESC VARCHAR(1000) DEFAULT NULL,
    LINK_URL VARCHAR(1000) DEFAULT NULL,
    LINK_STYLE VARCHAR(255) DEFAULT NULL,
    LINK_KEYWORD VARCHAR(1000) DEFAULT NULL,
    LINK_ROLE VARCHAR(4000) DEFAULT NULL,
    USE_YN CHAR(1) NOT NULL DEFAULT 'N',
    SDATE BIGINT DEFAULT NULL,
    EDATE BIGINT DEFAULT NULL,
    OPEN_TYPE CHAR(1) DEFAULT NULL,
    OPEN_OPTION VARCHAR(1000) DEFAULT NULL,
    IMG_SRC VARCHAR(500) DEFAULT NULL,
    REG_ID VARCHAR(20) NOT NULL,
    REG_DT TIMESTAMP NOT NULL,
    UPD_ID VARCHAR(20) NOT NULL,
    UPD_DT TIMESTAMP NOT NULL,
    PRIMARY KEY (LINK_ID,LINK_CATG)
);

CREATE TABLE T_LINK_USER (
    LINK_ID VARCHAR(32) NOT NULL,
    COLOR VARCHAR(32) DEFAULT NULL,
    PAGE_NO BIGINT DEFAULT NULL,
    SORT_ORDER BIGINT DEFAULT NULL,
    REG_ID VARCHAR(50) NOT NULL,
    REG_DT TIMESTAMP NOT NULL,
    PRIMARY KEY (LINK_ID)
);

CREATE TABLE T_NOTY (
    NOTY_ID VARCHAR(32) NOT NULL,
    NOTY_TYPE CHAR(2) DEFAULT NULL,
    SND_SYS_CODE VARCHAR(10) DEFAULT NULL,
    MSG_TXT VARCHAR(4000) DEFAULT NULL,
    ACT_TYPE CHAR(1) DEFAULT NULL,
    ACT_URI VARCHAR(256) DEFAULT NULL,
    ACT_DATA VARCHAR(4000) DEFAULT NULL,
    ACT_OPTION VARCHAR(4000) DEFAULT NULL,
    SEND_ID VARCHAR(20) DEFAULT NULL,
    SEND_DT DATE DEFAULT NULL,
    REG_ID VARCHAR(20) NOT NULL,
    REG_DT TIMESTAMP NOT NULL,
    UPD_ID VARCHAR(20) NOT NULL,
    UPD_DT TIMESTAMP NOT NULL,
    PRIMARY KEY (NOTY_ID)
);

CREATE TABLE T_NOTY_RECV (
    NOTY_ID VARCHAR(32) NOT NULL,
    RECV_ID VARCHAR(50) NOT NULL,
    RECV_DT DATE DEFAULT NULL,
    VIEW_YN CHAR(1) DEFAULT 'N',
    PRIMARY KEY (NOTY_ID,RECV_ID)
);

CREATE TABLE T_PNCK_PAGE (
    PORTAL_ID VARCHAR(36) NOT NULL,
    PAGE_ID VARCHAR(36) NOT NULL,
    PAGE_UID VARCHAR(36) NOT NULL,
    PARENT_PAGE_ID VARCHAR(36) DEFAULT NULL,
    PAGE_LANG_KEY VARCHAR(255) DEFAULT NULL,
    PAGE_NAME VARCHAR(255) DEFAULT NULL,
    THEME_ID VARCHAR(36) NOT NULL,
    LAYOUT_ID VARCHAR(36) NOT NULL,
    USE_YN CHAR(1) NOT NULL DEFAULT 'N',
    SORT_ORDER BIGINT DEFAULT NULL,
    REG_ID VARCHAR(255) NOT NULL,
    REG_DT TIMESTAMP NOT NULL,
    UPD_ID VARCHAR(255) NOT NULL,
    UPD_DT TIMESTAMP NOT NULL,
    PRIMARY KEY (PORTAL_ID,PAGE_ID)
);

CREATE TABLE T_PNCK_PAGE_PORTLET_MAPPING (
    PORTAL_ID VARCHAR(36) NOT NULL,
    PAGE_ID VARCHAR(36) NOT NULL,
    CONTAINER_ID VARCHAR(100) NOT NULL,
    PORTLET_ID VARCHAR(36) NOT NULL,
    PREV_PORTLET_ID VARCHAR(36) DEFAULT NULL,
    SORT_ORDER BIGINT DEFAULT NULL,
    REG_ID VARCHAR(20) NOT NULL,
    REG_DT TIMESTAMP NOT NULL,
    PRIMARY KEY (PORTAL_ID,PAGE_ID,CONTAINER_ID,PORTLET_ID)
);

CREATE TABLE T_PNCK_PAGE_ROLE (
    PAGE_ID VARCHAR(36) NOT NULL,
    ROLE_INFO VARCHAR(255) NOT NULL,
    AUTH_TYPE VARCHAR(2) DEFAULT NULL,
    REG_ID VARCHAR(255) NOT NULL,
    REG_DT TIMESTAMP NOT NULL,
    PRIMARY KEY (PAGE_ID,ROLE_INFO)
);

CREATE TABLE T_PNCK_ROLE (
    ROLE_ID VARCHAR(36) NOT NULL,
    ROLE_NAME VARCHAR(255) NOT NULL,
    ROLE_DESC VARCHAR(1000) DEFAULT NULL,
    REG_ID VARCHAR(20) NOT NULL,
    REG_DT TIMESTAMP NOT NULL,
    UPD_ID VARCHAR(20) NOT NULL,
    UPD_DT TIMESTAMP NOT NULL,
    PRIMARY KEY (ROLE_ID)
);

CREATE TABLE T_PNCK_ROLE_AUDIT_LOG (
    CONT_ID VARCHAR(36) NOT NULL,
    ROLE_INFO VARCHAR(100) DEFAULT NULL,
    CONT_TYPE CHAR(1) DEFAULT NULL,
    ACT_TYPE CHAR(1) DEFAULT NULL,
    USR_ID VARCHAR(32) NOT NULL,
    USR_IP VARCHAR(40) DEFAULT NULL,
    REG_ID VARCHAR(255) NOT NULL,
    REG_DT TIMESTAMP NOT NULL
);

CREATE TABLE T_PNCK_THEME (
    THEME_ID VARCHAR(36) NOT NULL,
    THEME_NAME VARCHAR(255) DEFAULT NULL,
    THEME_PATH VARCHAR(255) DEFAULT NULL,
    THEME_IMG VARCHAR(255) DEFAULT NULL,
    THEME_DESC VARCHAR(2000) DEFAULT NULL,
    DEFAULT_YN CHAR(1) NOT NULL DEFAULT 'N',
    REG_ID VARCHAR(20) NOT NULL,
    REG_DT TIMESTAMP NOT NULL,
    UPD_ID VARCHAR(20) NOT NULL,
    UPD_DT TIMESTAMP NOT NULL,
    PRIMARY KEY (THEME_ID)
);

CREATE TABLE T_BINARY (
    BINARY_ID BIGINT NOT NULL,
    BINARY_DATA BYTEA,
    PRIMARY KEY (BINARY_ID)
);

